import React, { useState } from 'react'
import axios from 'axios';
import { useDispatch, useSelector } from 'react-redux';
import { signin } from '../../redux/actions';
import { useNavigate } from 'react-router-dom';
import { Toast } from 'bootstrap'
import { MyToast } from '../secondarys/Toasts';

const Login = () => {
    const navigate = useNavigate();

    const [name, setName] = useState('');
    const [LastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');

    const state = useSelector((s) => s.controlItems);
    const dispatch = useDispatch();

    const submitHandler = async (e) => {
        e.preventDefault();
        try {
            const { data } = await axios.post('/api/users/signup', {
                email,
                password,
            });
            dispatch(signin(data));
            localStorage.setItem('userInfo', JSON.stringify(data));
            window.location.reload();

        } catch (error) {
            console.log(error.stack);
            {
                const myToast = document.querySelector('.toast-invalid-user')
                const bsToast = new Toast(myToast)
                bsToast.show();
            }
        }
    };
    return (
        <div>
            {/* <!-- Button trigger modal --> */}
            <button type="button " className="btn btn-outline-primary ms-2" data-bs-toggle="modal" data-bs-target="#signupModal" >
                <span className='fa fa-user-plus me-1'></span>Regístrate
            </button>

            {/* <!-- Modal --> */}
            <div className="modal fade" id="signupModal" tabIndex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div className="modal-dialog">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h1 className="modal-title fs-5" id="exampleModalLabel">INGRESA TUS DATOS</h1>
                            <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                        </div>
                        <div className="modal-body">
                            <button className="btn btn-primary w-100 mb-4 my-3">
                                <span className='fa fa-google me-2'></span> Registrate con Google
                            </button>
                            <button className="btn btn-primary w-100 mb-4">
                                <span className='fa fa-facebook me-2'></span> Registrate con Facebook
                            </button>
                            <form>
                                <div className="mb-2">
                                    <label htmlFor="exampleInput" className="form-label">Nombre</label>
                                    <input type="text" className="form-control" id="exampleInput" />
                                    <label htmlFor="exampleInput" className="form-label">Apellidos</label>
                                    <input type="text" className="form-control" id="exampleInput" />
                                </div>
                                <div className="mb-2">
                                    <label htmlFor="exampleInputEmail1" className="form-label">Correo electrónico</label>
                                    <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                                    <div id="emailHelp" className="form-text">Nosotros nunca compartiremos tus datos con nadie.</div>
                                </div>
                                <div className="mb-1">
                                    <label htmlFor="exampleInputPassword1" className="form-label">Contraseña</label>
                                    <input type="password" className="form-control" id="exampleInputPassword1" />
                                </div>
                                <div className="mb-3">
                                    <label htmlFor="exampleInputPassword2" className="form-label">Repita contraseña</label>
                                    <input type="password" className="form-control" id="exampleInputPassword2" />
                                </div>
                                <div className="mb-2 form-check">
                                    <input type="checkbox" className="form-check-input" id="exampleCheck1" />
                                    <label className="form-check-label" htmlFor="exampleCheck1">Acepto los terminos y condiciones</label>
                                </div>
                                <button type="submit" className="btn btn-outline-primary w-100 mt-4">ACEPTAR</button>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Login
